// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.19;

import "./FreelanceAgreement.sol";

contract ContractFactory {
    address[] public deployedContracts;
    
    event ContractCreated(
        address indexed contractAddress, 
        address indexed client, 
        address indexed freelancer,
        uint256 totalAmount
    );
    
    function createContract(
        address _freelancer,
        FreelanceAgreement.Milestone[] calldata _milestones,
        uint256 _totalAmount
    ) external payable returns (address) {
        require(msg.value >= _totalAmount, "Insufficient ETH sent");
        require(_freelancer != address(0), "Invalid freelancer address");
        require(_milestones.length > 0, "At least one milestone required");
        
        // Verify milestones sum matches total amount
        uint256 sum;
        for (uint i = 0; i < _milestones.length; i++) {
            sum += _milestones[i].amount;
        }
        require(sum == _totalAmount, "Milestone amounts don't match total");
        
        FreelanceAgreement newContract = new FreelanceAgreement{value: _totalAmount}(
            _freelancer,
            _milestones,
            _totalAmount
        );
        
        deployedContracts.push(address(newContract));
        
        // Return any excess ETH to client
        if (msg.value > _totalAmount) {
            payable(msg.sender).transfer(msg.value - _totalAmount);
        }
        
        emit ContractCreated(
            address(newContract), 
            msg.sender, 
            _freelancer,
            _totalAmount
        );
        
        return address(newContract);
    }
    
    function getDeployedContracts() external view returns (address[] memory) {
        return deployedContracts;
    }

    function getDeployedContractsCount() external view returns (uint256) {
        return deployedContracts.length;
    }
}
